import { useState } from 'react';
import './style.scss';

function App() {
	const [Num, setNum] = useState(0);
	return (
		<>
			<button onClick={() => setNum(Num - 1)}>Prev</button>
			<button onClick={() => setNum(Num + 1)}>next</button>

			<article style={{ transform: `rotate(${45 * Num}deg)` }}></article>
		</>
	);
}

export default App;
